def data_balance(diakg_have_re_path,diakg_no_re_path):
    diakg_have_re=[]
    diakg_no_re=[]
    '''读取文件 diakg_have_re.txt'''
    with open(diakg_have_re_path,'r',encoding='utf-8') as f:
        diakg_have_re = f.readlines()
    # print(diakg_have_re)
    f.close()
    '''读取文件 diakg_no_re.txt'''
    with open(diakg_no_re_path,'r',encoding='utf-8') as f:
        diakg_no_re = f.readlines()
    # print(diakg_no_re)
    f.close()

    print("---diakg_have_re的数据数量：",len(diakg_have_re))
    print("---diakg_no_re的数据数量：",len(diakg_no_re))

    '''随机选择无关系数据'''
    temp_list = []
    for i in range(8124):
        temp_list.append(randint(0,len(diakg_no_re)))
    print("---产生的随机数：",temp_list)
    print("---产生的随机数数量：",len(temp_list))

    diakg_no_re_select=[]
    for i in temp_list:
        diakg_no_re_select.append(diakg_no_re[i])
    # print("---随机选择的无关系数据：",diakg_no_re_select)
    print("---随机选择的无关系数据数量：",len(diakg_no_re_select))
    return diakg_have_re,diakg_no_re_select

diakg_have_re_ok_path = '../datasets/diakg/diakg_have_re_ok.txt'
diakg_no_re_ok_path = '../datasets/diakg/diakg_no_re_ok.txt'
diakg_have_re,diakg_no_re_select = data_balance(diakg_have_re_ok_path,diakg_no_re_ok_path)

import random
def data_split(diakg_have_re,diakg_no_re_select,train_rate,dev_rate,test_rate):
    '''对数据进行切分,先随机打乱合并后的数据,再按比例切分'''
    all_list = diakg_have_re+diakg_no_re_select

    '''查看一下句子的长度'''
    len_list = []
    for sentence in all_list:
        sentence = eval(sentence)
        len_list.append(len(sentence['token']))
    # print("---句子长度列表:",len_list)
    print("---句子长度列表长度:",len(len_list))
    print("---最长句子字符个数：",max(len_list),"最短句子字符个数：",min(len_list))
    # print(all_list)
    print("---合并后的数据数量：",len(all_list))
    random.shuffle(all_list)
    # print(all_list)

    '''训练集的切分点'''
    train_split_spot = int((train_rate / (train_rate + dev_rate + test_rate)) * len(all_list))
    dev_split_spot = int(train_split_spot+((len(all_list)-train_split_spot)/2))
    print("---train_split_spot:",train_split_spot)
    print("---dev_split_spot:",dev_split_spot)

    '''切分'''
    train_list = all_list[:train_split_spot]
    dev_list = all_list[train_split_spot:dev_split_spot]
    test_list = all_list[dev_split_spot:]
    print("---train_list的数量：",len(train_list))
    print("---dev_list的数量：",len(dev_list))
    print("---test_list的数量：",len(test_list))
    return train_list,dev_list,test_list



'''以8：1：1对数据进行切分'''
